import React,{useEffect} from 'react'
import { Button, Table } from 'react-bootstrap'
import { getAllExams } from '../../Actions/examAction';
import { useSelector,useDispatch } from 'react-redux';
import Loader from '../Loader';
import Error from '../Error';

function UserHome() {
    const dispatch = useDispatch();
    const examState = useSelector((state)=>state.getExamReducer)
    const {loading,error,Allexam} = examState;

    useEffect(()=>{
        dispatch(getAllExams())
    },[dispatch])

  return (
    <>
        <div style={{padding:'6rem'}}>
        {loading && <Loader/>}
      {error && <Error error="Error While Fetching Users" />}
            <Table border={2}>
                <thead>
                    <tr>
                        <th>Exam Name</th>
                        <th>Teacher Name</th>
                        <th>Exam Date</th>
                        <th>Start Exam</th>
                        <th>Result</th>            
                    </tr>
                </thead>
                <tbody>
                    {Allexam && 
                    Allexam.map((exam)=>(
                        <tr key={exam._id}>
                            <td>{exam.exam_name}</td>
                            <td>{exam.teacher_name}</td>
                            <td>{exam.exam_date}</td>
                            <td><Button>Start</Button></td>
                            <td>result</td>
                        </tr>
                    ))}
                </tbody>
            </Table>
        </div>
    </>
  )
}

export default UserHome
